import React from 'react'

export default function DailyForecast({dailyForecast}) {
    // console.log(dailyForecast)
    const upcomingDays = Array.from(dailyForecast)

    let todayDate = new Date();
    let newDays;
    let allDaysArray = []

    for(let i = 0; i < upcomingDays.length; i++) {
        todayDate.setDate(todayDate.getDate() + 1)
        newDays = todayDate.toLocaleString('sv-SE',{weekday: 'long', month:'short', day:'numeric'}).replace(".", "")
        allDaysArray.push(newDays)
    }

    let icon;
    let precipitation;
    let details = upcomingDays.map((oneDay, i) => {
        let upcomingTemperature = oneDay?.temp?.day;
        let weatherDescription = oneDay?.weather?.[0]?.description;
        let day = allDaysArray[i];

        if(oneDay.snow !== undefined){
            precipitation = (oneDay.snow).toFixed(1);
        }else{
            precipitation = 0;
        }

        if(oneDay?.rain !== undefined){
            precipitation = (oneDay?.rain).toFixed(1);
        }else{
            precipitation = 0;
        }

        function capitalize(){
            weatherDescription = weatherDescription.charAt(0).toUpperCase() + weatherDescription.slice(1);
            day = day.charAt(0).toUpperCase() + day.slice(1);
            return weatherDescription, day
        }

        if(weatherDescription.includes("snöfall")){
            icon = <img className="icon-img" alt="icon" src="data:image/svg+xml;base64," />
        }else if(weatherDescription.includes("snöbyar")){
            icon = <img className="icon-img" src="data:image/svg+xml;base64," />
        }else if(weatherDescription.includes("klar himmel")){
            icon = <img className="icon-img" alt="icon" src="data:image/svg+xml;base64," />
        }else if(weatherDescription.includes("mulet")|| weatherDescription.includes("molnigt")){
            icon = <img className="icon-img" alt="icon" src="data:image/svg+xml;base64," />
        }else if(weatherDescription.includes("molnighet")){
            icon = <img className="icon-img" alt="icon" src="data:image/svg+xml;base64," />
        }else if(weatherDescription.includes("dimma") || weatherDescription.includes("smogg") || weatherDescription.includes("dis")){
            icon = <img className="icon-img" alt="icon" src="data:image/svg+xml;base64," />
        }else if(weatherDescription.includes("åskväder") || weatherDescription.includes("kraftigt åskväder")){
            icon = <img className="icon-img" alt="icon" src="data:image/svg+xml;base64," />
        }else if(weatherDescription.includes("vindstötar")){
            icon = <img className="icon-img" alt="icon" src="data:image/svg+xml;base64," />
        }else if(weatherDescription.includes("lätt regn") || weatherDescription.includes("något regn") || weatherDescription.includes("måttligt regn") || weatherDescription.includes("enstaka regnskurar") || weatherDescription.includes("lätta regnskurar")){
            icon = <img className="icon-img" alt="icon" src="data:image/svg+xml;base64," />
        }else if(weatherDescription.includes("regn och snö") || weatherDescription.includes("lätt regn och snö") || weatherDescription.includes("skurar med snöblandat regn") || weatherDescription.includes("snöblandat regn")){
            icon = <img className="icon-img" alt="icon" src="data:image/svg+xml;base64," />
            // icon = <img className="icon-img" alt="icon" src="data:image/svg+xml;base64," />
        }else if (weatherDescription.includes("kraftigt regn") || weatherDescription.includes("rikligt med regn") || weatherDescription.includes("regnskurar") || weatherDescription.includes("kraftiga regnskurar")){
            icon = <img className="icon-img" alt="icon" src="data:image/svg+xml;base64," />
        }else if(weatherDescription.includes("tromb")){
            icon = <img className="icon-img" alt="icon" src="data:image/svg+xml;base64," />
        }
        else{
            icon = weatherDescription;
        }

        capitalize();
        
        return <div className="daily-weather-div">
            <div className="dayOfTheWeek"> {day} </div>
            <div title={weatherDescription}>{icon}</div>
            <div className="precipitation-div">
                <div className="more-info-div">
                    {upcomingTemperature <= 0 ? 
                        <img className="precipitation-img" alt="icon" src="data:image/svg+xml;base64," />
                    :
                        <img className="precipitation-img" alt="icon" src="data:image/svg+xml;base64," />
                    }
                    <p>{Math.round(upcomingTemperature)} °C</p>
                </div>
                <div className="more-info-div">
                    <img className="precipitation-img" alt="icon" src="data:image/svg+xml;base64," />
                    <p> {precipitation} mm</p>
                </div>
            </div>
        </div>
    })

    // let details = weather_details.map((days) => {
    //     return <div className="daily-weather-div">
    //         <div> {days.weekday} </div>
    //         {icon}
    //         <div><p className="daily-description"> {days.description} </p></div>
    //         <div>Temperatur: {Math.round(days.temp)} °C</div>
    //         <div> <p>Känns som:</p> {Math.round(days.feels_like)} °C</div>
    //     </div>
    // })

    return (
        <>
            {details}
        </>
    )
}
